// import { createApp } from 'vue'
// import App from './App.vue'
// import axios
// import axios from 'axios'

// set a prototype for http
// Vue.prototype.$http = axios;

// createApp(App).mount('#app')

import Vue from 'vue'
import App from './App.vue'

// import axios
import axios from 'axios'

// set a prototype for http
Vue.prototype.$http = axios;

Vue.config.productionTip = false

new Vue({
  render: h => h(App),
}).$mount('#app')
